import { Container, Row, Col, Button } from "react-bootstrap";
import Navbar from "../components/navbar/Navbar"


function HomePage(){
return (
  <><Navbar />
    <Container>
        <h1 className="text-center mt-5 pt-5 f-1">With us, you can shop online & help</h1>
        <h1 className="text-center f-1">save your high street at the same time</h1>
    </Container>
       <Container>
       <div className="card" >
          <img src="public/profile.jpg" className="card-img-top mx-auto d-block" />
          <div className="card-body" >
            <h4 className="card-title" >Husni Mubarak</h4>
            <p className="card-text" >Fullstack Developer</p>
          </div>
        </div>
   </Container>
  </>
  );
}

export default HomePage;
